INSERT INTO `website` (`id`, `type`, `title`, `content`, `h1`, `h2`, `video_link`, `image_link`, `display`, `isFile`, `priority`, `createdAt`, `updatedAt`) VALUES
(1, 'terms-of-service', 'เงื่อนไขการให้บริการ', '<h2><strong>ข้อแนะนำในการใช้บริการเว็ปไซต์</strong></h2><p>&nbsp;</p><p>1.กรุณาเก็บในเสร็จไว้ทุกครั้งที่สั่งซื้อเพื่อใช้ในการอ้างอิงการขอรับประกันหรือติดตามสินค้า</p><p>&nbsp;</p><p>2.เงื่อนไขการรับประกัน</p><p>&nbsp; &nbsp;A. สินค้าไม่ตรงตามข้อมูลที่ระบุในรายละเอียดการขาย<br>&nbsp; &nbsp;B. พบว่าสินค้าชิ้นดังกล่าวไม่ได้เป็นแบรนด์เนมของแท้ตามที่ระบุในรายละเอียดการขาย<br>&nbsp;</p><h2><br><strong>การขอเคลมประกันสินค้า</strong></h2><p>&nbsp;</p><p>1.ทุกครั้งที่ติดต่อแอดมินเพื่อขอเคลมสินค้าต้องมีหลักฐานประกอบสองอย่าง</p><p>&nbsp; A.คลิปตั้งแต่ตอนเปิดบรรจุภัณฑ์ของสินค้าจนถึงตอนตรวจพบหลักฐานจุดที่จะเคลม<br>&nbsp; ฺB.ใบเสร็จคำสั่งซื้อสินค้าชิ้นั้นๆ</p><p><br>2.ติดต่อแอดมินไม่เกิน 1 วันหลังได้รับสินค้า (อ้างอิงจากวันใน Tracking ของขนส่ง)</p><p><br>3.ทุกกรณีที่ขอเคลมสินค้า ผู้ซื้อต้องส่งสินค้าคืนให้กับผู้ขาย โดยแอดมินจะเป็นผู้ประสานงานให้ทั้งสองฝ่าย<br>โดยค่าใช้จ่ายการส่งคืนเป็นของผู้ซื้อ และจะได้รับเงินค่าสินค้าทั้งหมดเมื่อผู้ขายได้รับสินค้าคืนตามสภาพเดียวกับในคลิปที่ขอเคลม</p>', '01 . Massa quis risus eu arcu est sodales. fox.', '02 . Laoreet enim egestas aliquet ac rhoncus vel.', '', '', 'yes', 0, 0, '2022-07-09 04:19:24', '2024-06-17 13:48:46'),
(2, 'privacy-policy', 'เงื่อนไขการให้บริการ', '<p>1.ต้องเป็นสินค้าแบรนด์เนมของแท้เท่านั้น</p><p><br>2.ติดต่อแอดมินเพื่อขอรับค่าสินค้าพร้อมกับแนบ Tracking status ว่าผู้ซื้อได้รับสินค้าแล้วทุกครั้ง</p><p>&nbsp;</p><p>3.ทางเว็ปไซต์จะดำเนินการโอนเงินค่าสินค้า ภายใน 1-2 วันหลังได้รับการติดต่อ</p><p><br>4.ถ้าสินค้ามีตำหนิต้องระบุลักษณะและจำนวนตำหนิของสินค้าให้ชัดเจน</p><p>&nbsp;</p><p>5.ทุกกรณีสามารถเก็บเงินปลายทางได้โดยผู้ขายยังได้รับเงินเต็มจำนวนเหมือนเดิม</p><p>โดยส่งในนาม คุณเกียรติศักดิ์ ขนส่ง Kerry เบอร์โทร&nbsp;&nbsp;<br><br>&nbsp; **ต้องซื้อประกันสินค้าตีกลับกับขนส่งเท่านั้น ผู้ขายจึงจะได้รับเงินค่าส่งสินค้าเต็มจำนวนในกรณีที่ขนส่งติดต่อผู้ซื้อไม่ได้/หรือผู้ซื้อไม่รับของ</p><p>&nbsp;</p><p>6.กรณีไม่ได้ส่งของเเบบเก็บเงินปลายทางผ่านทางเว็ปไซต์(ตามข้อมูลในข้อ 5) สินค้าจะไม่อยู่ในเงื่อนไขการันตีและจะถูกตีกลับจากผู้ซื้ออัตโนมัติ</p><p><br>7.กรณีมีการร้องเคลมสินค้าจากผู้ซื้อและมีการส่งสินค้าคืน เมื่อผู้ขายได้รับสินค้าแล้วต้องทำการถ่ายคลิปตรวจสอบสินค้าตีกลับเพื่อยืนยันความเรียบร้อยทุกครั้ง<br>และค่าใช้จ่ายการส่งของไปให้ลูกค้าในครั้งแรกเป็นของผู้ขาย</p>', '01 . Massa quis risus eu arcu est sodales. fox.', '02 . Laoreet enim egestas aliquet ac rhoncus vel.', '', '', 'yes', 0, 0, '2022-07-09 04:19:24', '2024-06-19 03:29:50'),
(3, 'home', 'หน้าแรก', 'บริหารจัดการโดย บริษัท เฮฟเว่นพลัส อินเตอร์เนชั่นแนล จำกัด \r\n64/40 หมู่ 7 ถ.ข้าวหลาม ต.เสม็ด อ.เมือง จ.ชลบุรี\r\nนิติบุคคลเลขที่ 0205563000409', 'รับโปรโมชั่นสมาชิกฟรี หรือสอบถามข้อมูลเพิ่มเติม คลิ๊กที่ปุ่มติดต่อเรา ', 'Fillfin.com ศูนย์รวมชุดชั้นในมือสอง เสื้อผ้ามือสอง ที่มาตรฐานและใหญ่ที่สุดในประเทศไทย', 'video/2023/08/filfin-720.mp4', '', 'yes', 1, 0, '2022-07-09 04:19:24', '2024-05-29 06:12:54'),
(4, 'term-member', 'ข้อกำหนดการสมัครสมาชิก', '<p>1.กรอกตัวเลข 10 หลักเพื่อใช้เป็น USER &nbsp;ในการ Login ใช้งานบนเว็ปไซต์ (แนะนำเป็นเบอร์โทรศัพท์เพื่อง่ายต่อการจดจำและการติดต่อสื่อสาร)</p><p><br>2.เลือก PACKAGE (กรณีคูปองโปรโมชั่น กรุณาเลือก Package Premium)</p><p><br>3.หลังจากการสมัครเสร็จสิ้น เว็ปไซต์จะทำการอนุมัติการเป็นสมาชิกภายใน 30 นาที หรือสามารถแจ้งแอดมินทางไลน์@เพื่อดำเนินการอนุมัติหลังเสร็จสิ้นการสมัคร</p><p>&nbsp;</p><p>4.การสมัครสมาชิกหลังเวลา 22.00 น. การอนุมัติจะมีผลในเวลา 08.00 น. ในวันถัดไป (กรณีที่ยังไม่สามารถใช้งานเว็ปไซต์ได้ กรุณาติดต่อไลน์@)</p><p>&nbsp;</p><p>5.กรณีการสั่งซื้อสินค้าแล้วพบปัญหา ทางเว็ปไซต์จะเป็นผู้ประสานงานเพื่อหาทางออกของทั้งผู้ซื้อและผู้ขายร่วมกันทั้งสองฝ่าย</p><p>&nbsp;</p>', '01 . Massa quis risus eu arcu est sodales. fox.', '02 . Laoreet enim egestas aliquet ac rhoncus vel.', 'video/2023/04/1680996668203(1).mp4', '', 'yes', 1, 0, '2022-07-09 04:19:24', '2023-04-08 23:32:22'),
(5, 'term-store', 'ข้อกำหนดการสมัครร้านค้า', '<p>1.ตั้งชื่อร้านเป็นภาษาอังกฤษหรือตัวเลขเท่านั้น</p><p><br>2.กรอกเบอร์โทรเพื่อใช้เป็น USER ในการ Login เข้าระบบลงขายสินค้า</p><p>&nbsp;</p><p>3.รูปภาพโปรไฟล์ของร้านค้า ต้องเป็นรูปจากตัวตนที่แท้จริงเท่านั้น</p><p>&nbsp;</p><p>4.เมื่อสมัครเสร็จกรุณาติดต่อแอดมินตาม Contact ด้านล่างเพื่อแจ้งเปิดร้านค้า, รับคู่มือการลงขายสินค้า และจะเป็นช่องทางการสื่อสารเรื่องการโอนชำระค่าสินค้าเมื่อมีคำสั่งซื้อเข้ามา</p>', '01 . Massa quis risus eu arcu est sodales. fox.', '02 . Laoreet enim egestas aliquet ac rhoncus vel.s', 'video/2023/04/1681003728596.mp4', '', 'yes', 1, 0, '2022-07-09 04:19:24', '2023-04-09 01:29:25'),
(7, 'email-website', 'email', 'fillfin.support@gmail.com', 'support fillfin', 'support fillfin', '', '', 'yes', 0, 0, '2022-07-09 04:19:24', '2022-08-06 10:47:32'),
(8, 'term-store-post', 'ข้อกำหนดการโพสต์โปรไฟล์ผู้ขาย', '<p>1.ไม่อนุญาตให้มีช่องทางการติดต่อส่วนตัวในรูปภาพหรือข้อความเพื่อความปลอดภัยของร้านค้าและป้องกันการแอบอ้างเครดิตของทางเว็ปไซต์&nbsp;</p><p>2.ไม่ใช้รูปภาพโป๊เปลือยในการนำเสนอ&nbsp;</p><p>3.ไม่ใช้ข้อความหยาบคายหรือไม่เหมาะสม&nbsp;</p><p>4.ทุกคำสั่งซื้อ ต้องทำการยืนยันออเดอร์กับแอดมินผ่านทางไลน์@&nbsp;<br>5.กรณีหยุดขายชั่วคราว สามารถแจ้งแอดมินให้ปิดร้านและสามารถแจ้งแอดมินให้เปิดร้านในกรณีพร้อมที่จะขายต่อได้โดยข้อมูลทุกอย่างยังคงเดิม</p><p>6.ส่งสินค้าในนาม “บริษัท เฮฟเว่นพลัส อินเตอร์เนชันแนล จำกัด 64/40 หมู่ 7 ถ.ข้าวหลาม ต.เสม็ด อ.เมือง จ.ชลบุรี 20130/0927125055” (เปิดAccountขนส่งเรียบร้อยแล้ว)</p><p>7.ร้านค้าสามารถติดต่อแอดมินเพื่อรับโอนค่าสินค้าได้เมื่อเช็คสถานะแล้วว่าสินค้าถึงมือผู้รับแล้ว (ติดต่อพร้อมหลักฐานการเช็คสถานะ)&nbsp;</p><p>8.การโอนค่าสินค้าจะดำเนินการภายใน 1-3 วัน&nbsp;</p><p>9.กรณีการสั่งซื้อสินค้าแล้วพบปัญหา ทางเว็ปไซต์จะเป็นผู้ประสานงานเพื่อหาทางออกของทั้งผู้ซื้อและผู้ขายร่วมกันทั้งสองฝ่าย&nbsp;</p><p>10.หากพบข้อมูลที่ลงในเว็ปไซต์ไม่ใช่ตัวตนจริง หรือเป็นการ Copy มาจากแหล่งอื่นที่ก่อให้เกิดปัญหาการร้องเรียน เว็ปไซต์จะทำการปิดร้านค้านั้นโดยทันที</p>', 'Lorem ipsum dolor sit amet, consectetur', 'Lorem ipsum dolor sit amet, consecteturzz', '', '', 'yes', 0, 0, '2022-07-10 04:19:24', '2023-04-18 14:36:18'),
(9, 'store-men', 'MEN', 'คลิ๊กชมสินค้าแต่ละร้านด้านใน หากต้องการรับ Promotion ใช้งานเว็ปไซต์ฟรีกรุณาติดต่อแอดมินที่ปุ่มติดต่อเรา', '', '', '', '', 'yes', 0, 0, '2022-07-10 04:19:24', '2023-03-12 13:00:46'),
(10, 'store-women', 'WOMEN', 'คลิ๊กชมสินค้าแต่ละร้านด้านใน หากต้องการ Promotion ใช้งานเว็ปไซต์ฟรีกรุณาติดต่อแอดมินที่ปุ่มติดต่อเรา', '', '', '', '', 'yes', 0, 0, '2022-07-10 04:19:24', '2023-03-12 07:28:31'),
(11, 'cart-order', 'ตระกร้าสินค้า', '<p>1.สินค้าพร้อมส่งใช้เวลา 2-3 วันตามรอบการจัดส่งของร้านค้าและระยะทางการขนส่ง</p><p>&nbsp;</p><p>2.สินค้าสั่งจองล่วงหน้า (Pre-order) ใช้เวลา 4-7 วัน ตามรอบการดำเนินการของร้านค้าและระยะทางการขนส่ง</p><p>&nbsp;</p><p>3.เพื่อป้องกันสินค้ามีปัญหากรุณาถ่ายคลิปทุกครั้งขณะแกะบรรจุภัณฑ์เพื่อใช้เป็นหลักฐานการเคลม</p>', '', '', '', '', 'yes', 0, 0, '2022-07-10 04:19:24', '2023-03-05 13:40:29'),
(12, 'fashion', 'หน้าแรกสินค้าแฟชั่น', 'บริหารจัดการโดย บริษัท เฮฟเว่นพลัส อินเตอร์เนชั่นแนล จำกัด 64/40 หมู่ 7 ถ.ข้าวหลาม ต.เสม็ด อ.เมือง จ.ชลบุรี นิติบุคคลเลขที่ 0205563000409\r\n', 'หากมีข้อสงสัยเรื่องการใช้งานเว็ปไซต์ กรุณาติดต่อแอดมินที่ปุ่มขวาล่าง', 'Fillfin.com  ศูนย์รวม ซื้อ-ขาย สินค้าแฟชั่นมือสองแบรนด์เนมที่มีระบบการันตีมาตรฐานใหญ่ที่สุดในประเทศไทย ', 'video/2024/06/1000018851.mp4', '', 'yes', 1, 0, '2024-05-02 04:19:24', '2024-06-27 22:14:00'),
