(15, 'fashion-payment', 'ขำระเงินสินค้าแฟชั่น', '<p><strong>รายละเอียด</strong></p><p>กรณีเก็บเงินปลายทาง โอนค่ามัดจำ 50 บาท เพื่อเป็นการยืนยันการจองสินค้า</p>', '', '', '', '', 'yes', 1, 0, '2024-05-02 04:19:24', '2024-05-02 13:40:29');
